import { useEffect, useState } from "react";
import Records from '../data/data.json';

function Cases() {
  const [data, setData] = useState([]); // store data collection

  // fetch data
  fetch("../data/data")
          .then((response) => response.json())
          .then((json) => {
          console.log(json);
          setData(json);
       }).then(error => {
          console.log("something went wrong: " + error)
  })

  useEffect(() => {
      document.title = 'Gallery';
  }, []);

    return (
        <section className="section site-portfolio container">
            <div className="row mb-3 align-items-center">
              <div class="col-md-12 col-lg-6 mb-4 mb-lg-0" data-aos="fade-up">
                <h2>Cases</h2>
              </div>
            </div>
            {
            Records.map(record => {
              return (
            <div id="portfolio-grid" className="row no-gutter" data-aos="fade-up" data-aos-delay="200" key={data.id}>
              <div className="item web col-sm-6 col-md-4 col-lg-4 mb-4">
                <a href="work-single.html" className="item-wrap fancybox">
                  <div className="work-info">
                    <h3>Boxed Water</h3>
                    <span>Web</span>
                  </div>
                  <img className="img-fluid" src={record.title} alt="" style={{marginTop: 30}} />
                </a>
              </div>
            </div>
                   )
                  })}
        </section>
    );
}

export default Cases;
